mapper.select:
select
  ${fieldName}
from tb_metrics_process
where
  hostName = #{hostName,jdbcType=VARCHAR}
  and
  heartbeatTime > #{startTime} and heartbeatTime <= #{endTime}
order by heartbeatTime desc
  limit 1

SELECT SUM(t1.stat) FROM (
    SELECT ${function}(${fieldName}) AS 'stat'
    from tb_metrics_process
    where heartbeatTime >= #{startTime} and heartbeatTime <= #{endTime}
    GROUP BY hostName
) AS t1

select * from (
select
${function}(${fieldName}) as 'aggVal',
hostName as 'hostName'
from tb_metrics_process
where
${sortTimeField} = #{sortTime,jdbcType=BIGINT}
group by hostName
) as agg_table
order by agg_table.aggVal ${sortType}

  limit #{topN}

select
  ${function}(${fieldName})
from tb_metrics_process
where
  hostName = #{hostName,jdbcType=VARCHAR}
  and
  heartbeatTime > #{startTime}
  and
  heartbeatTime <= #{endTime}
